import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './IbanSearch.css';

const IbanSearch = () => {
    const [filters, setFilters] = useState({
        year: new Date().getFullYear(),
        ecoCode: '',
        raionCode: '',
        localityCode: ''
    });

    const [ecoCodes, setEcoCodes] = useState([]);
    const [raions, setRaions] = useState([]);
    const [localities, setLocalities] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [ibanResult, setIbanResult] = useState(null);

    // Fetch initial filter data
    useEffect(() => {
        const fetchFilterData = async () => {
            setLoading(true);
            setError('');

            try {
                const token = localStorage.getItem('token');
                const headers = { 'Authorization': `Bearer ${token}` };

                const [ecoResponse, raionResponse] = await Promise.all([
                    axios.get('/api/ibans/eco-codes', { headers }),
                    axios.get('/api/ibans/raions', { headers })
                ]);

                setEcoCodes(ecoResponse.data);
                setRaions(raionResponse.data);
            } catch (err) {
                console.error('Error loading filter data:', err);
                setError('Nu s-au putut încărca datele pentru filtrare');
            } finally {
                setLoading(false);
            }
        };

        fetchFilterData();
    }, []);

    // Load localities when raion changes
    useEffect(() => {
        if (!filters.raionCode) {
            setLocalities([]);
            return;
        }

        const fetchLocalities = async () => {
            setLoading(true);
            try {
                const token = localStorage.getItem('token');
                const headers = { 'Authorization': `Bearer ${token}` };

                const response = await axios.get(`/api/ibans/localities/${filters.raionCode}`, { headers });
                setLocalities(response.data);
            } catch (err) {
                console.error('Error loading localities:', err);
                setError('Nu s-au putut încărca localitățile');
            } finally {
                setLoading(false);
            }
        };

        fetchLocalities();
    }, [filters.raionCode]);

    // Handle input changes
    const handleChange = (e) => {
        const { name, value } = e.target;

        // Reset dependent fields when specific fields change
        if (name === 'raionCode') {
            setFilters(prev => ({
                ...prev,
                [name]: value,
                localityCode: '' // Reset locality when raion changes
            }));
        } else {
            setFilters(prev => ({
                ...prev,
                [name]: value
            }));
        }
    };

    // Handle search
    const handleSearch = async () => {
        setLoading(true);
        setError('');

        try {
            const token = localStorage.getItem('token');
            const headers = { 'Authorization': `Bearer ${token}` };

            // Build query parameters
            const params = new URLSearchParams();
            Object.entries(filters).forEach(([key, value]) => {
                if (value) params.append(key, value);
            });

            // Perform search
            const response = await axios.get(`/api/ibans/filter?${params}`, { headers });
            setIbanResult(response.data);
        } catch (err) {
            console.error('Error searching IBAN:', err);
            setError('Nu s-a putut efectua căutarea');
        } finally {
            setLoading(false);
        }
    };

    // Handle export
    const handleExport = async () => {
        try {
            const token = localStorage.getItem('token');
            const headers = { 'Authorization': `Bearer ${token}` };

            const response = await axios.get('/api/ibans/export', {
                headers,
                responseType: 'blob'
            });

            // Create download link
            const url = window.URL.createObjectURL(new Blob([response.data]));
            const link = document.createElement('a');
            link.href = url;
            link.setAttribute('download', `registru_ibans_${new Date().toISOString().split('T')[0]}.csv`);
            document.body.appendChild(link);
            link.click();
            link.remove();
        } catch (err) {
            console.error('Error exporting CSV:', err);
            setError('Nu s-a putut exporta registrul');
        }
    };

    return (
        <div className="iban-search-container">
            <h1 className="search-title">Căutare IBAN</h1>

            <div className="search-row">
                <label>Anul:</label>
                <div className="select-container">
                    <select
                        name="year"
                        value={filters.year}
                        onChange={handleChange}
                    >
                        {[...Array(5)].map((_, i) => {
                            const yearOption = new Date().getFullYear() - i;
                            return (
                                <option key={yearOption} value={yearOption}>
                                    {yearOption}
                                </option>
                            );
                        })}
                    </select>
                </div>
                <div className="export-button">
                    <button onClick={handleExport}>Descarca registru</button>
                </div>
            </div>

            <div className="search-row">
                <label>Codul Eco:</label>
                <div className="select-container">
                    <select
                        name="ecoCode"
                        value={filters.ecoCode}
                        onChange={handleChange}
                    >
                        <option value="">Selectează Codul Eco</option>
                        {ecoCodes.map(eco => (
                            <option key={eco.code} value={eco.code}>
                                {eco.code} - {eco.label}
                            </option>
                        ))}
                    </select>
                </div>
            </div>

            <div className="search-row">
                <label>Raionul:</label>
                <div className="select-container">
                    <select
                        name="raionCode"
                        value={filters.raionCode}
                        onChange={handleChange}
                    >
                        <option value="">Selectează Raionul</option>
                        {raions.map(raion => (
                            <option key={raion.code} value={raion.code}>
                                {raion.code} - {raion.name}
                            </option>
                        ))}
                    </select>
                </div>
            </div>

            <div className="search-row">
                <label>Localitatea:</label>
                <div className="select-container">
                    <select
                        name="localityCode"
                        value={filters.localityCode}
                        onChange={handleChange}
                        disabled={!filters.raionCode}
                    >
                        <option value="">Selectează Localitatea</option>
                        {localities.map(locality => (
                            <option key={locality.code} value={locality.code}>
                                {locality.code} - {locality.name}
                            </option>
                        ))}
                    </select>
                </div>
            </div>

            <div className="button-container">
                <button
                    onClick={handleSearch}
                    className="search-button"
                    disabled={loading}
                >
                    {loading ? 'Se procesează...' : 'Afișează codul IBAN'}
                </button>
            </div>

            {error && <div className="error-message">{error}</div>}

            {ibanResult && ibanResult.length > 0 && (
                <div className="results-container">
                    <h3>Rezultate</h3>
                    <table className="results-table">
                        <thead>
                        <tr>
                            <th>Cod IBAN</th>
                            <th>An</th>
                            <th>Cod Eco</th>
                            <th>Localitate</th>
                        </tr>
                        </thead>
                        <tbody>
                        {ibanResult.map(iban => (
                            <tr key={iban.id}>
                                <td>{iban.ibanCode}</td>
                                <td>{iban.year}</td>
                                <td>{iban.ecoCode}</td>
                                <td>{iban.localityName}</td>
                            </tr>
                        ))}
                        </tbody>
                    </table>
                </div>
            )}
        </div>
    );
};

export default IbanSearch;
